INSERT INTO `formularios_calidad` (`id_formulario`, `fecha_real`, `id_usuario`, `fecha_deteccion`, `tipo`, `sector`, `deteccion`, `analisis`, `plan`, `verificacion`, `estado`) VALUES
(1, '2015-08-04 19:56:13', 14, '2015-03-27 03:00:00', 'INC - No Conformidad', 'Bloques', 'Algunos bloques salen del moldeo con material sin mezclar, los brazos de la mezcladora no estan en condiciones de lograr un mezclado eficiente.', 'Las placas de desgaste deben ser reemplazadas por nuevas.\r\nCristian di Gioia - Franco Juarez', 'Se reemplazaran las placas gastadas en la semana del 27/7/15. Franco Juarez', 'Se verifica visualmente que fueron reemplazadas las placas de desgaste del planetario, falta la placa raspadora de piso y paredes. 04/08/15.\r\nHable con Franco Juarez y me comento que el trabajo esta terminado mientras que Cristian di Gioia da conformidad del mismo  05/08/15', 2),
(2, '2015-08-10 18:38:12', 14, '2015-01-14 03:00:00', 'INC - No Conformidad', 'Viguetas', 'Perdida de arido cuando ingresa de la planta betonmac ala mescladora y cae sobre el riel de las tolvas. ', 'Participantes:Ing.Barnes Sebastian , Villalobos Fabian ,Juares Franco .\r\n_La distancia entre la cinta transportadora y la boca de la hormigonera es excesiva por deseño y deja caer arena por debajo .', '_Se solicito al taller de Nigra la colocacion de una bandeja que colecte el material que pudiera caer y ensuciar el riel .', '', 0),
(3, '2015-08-10 18:47:16', 14, '2015-03-26 03:00:00', 'INC - No Conformidad', 'Bloques', 'El vastago del cilindro del piston se encuentra soldado ; debe cambiarce lo antes posible para evitar accidentes y perdida de produccion . ', '', 'Se solicita a Caffot la fabricación de los cilindros y vástagos.', 'Se enviaron los cilindros para recambio nuevamente a Caffot para realizarles una modificacion pues quedaron cortos. 24/08/15', 1),
(4, '2015-08-10 18:57:02', 14, '2015-06-09 03:00:00', 'INC - No Conformidad', 'Bloques', 'La aplicacion de diferentes aditivos , segun necesidad , se debe hacer con un mismo deposito , ocacionando mescla de estos (con el peligro de tener efectos no deseados )y perdidas de tiempo en el cambio de los mismos . ', 'Participantes : Ing. Cristian Di Gioia, Franco Juarez \r\n_Actualmente hay un solo depocito para la dosificacion del acelerante y el plastificante . ', '_Solicitar a Mantenimiento que instale un depocito mas para el acelerante .\r\nResponsable :Juarez Franco .', '', 0),
(5, '2015-08-10 19:07:24', 14, '2015-06-29 03:00:00', 'INC - No Conformidad', 'Viguetas', 'No existe un procedimiento de producto NC para el hormigon elavorado . ', 'Participantes : Ing. Sebastian Barnes , Sergio Cortijos .\r\nEl procedimiento de producto N.C actual solo contempla produto terminado  y no al H como un producto intermedio del proceso .', '_Eleborar un procedimiento que  contemple el tratamiento de hormigon no conforme .\r\n_Capacitar a supervisores en procedimiento de producto N.C. \r\nResponsable : Sergio Cortijos ,Ing.Sebastian Barnes .', '', 1),
(6, '2015-08-10 19:13:28', 14, '2015-06-22 03:00:00', 'INC - No Conformidad', 'Viguetas', 'Colocar una resistencia para calentar el agua que se fabrica el hormigon . ', 'Participantes :Ing.Sebastian Barnes ,Franco Juarez , Villalobos Fabian \r\n_Por el cambio de planta hormigonera se dejo de calentar el agua de amasado al cambiar las instalaciones . ', '_Solicitar un sistema de calentamiento en el agua.\r\nResponsable : Juarez Franco ,Mantenimiento ', '', 0),
(7, '2015-10-01 14:39:59', 11, '2015-10-01 03:00:00', 'INC - No Conformidad', 'Viguetas', 'Los motores de traslación no están bien fijados', '', '', '', 0);
